const Auth = {
    isAuthenticated: false,
	
    authenticate() {
		this.isAuthenticated = true;
	},
		
	signout() {
		this.isAuthenticated = false;
		localStorage.clear();
	},
		
	getAuth() {
		return this.isAuthenticated;
	}
  };

  export default Auth;
